WebChartDateTimeUnitFormatOptions.description:
Interface used by the axis `valueFormat` property to describe how to format specific date and time units when displayed on the axis.
For instance:
"year": { year: "numeric" }
"month": { month: "numeric" }
"day": { day: "2-digit" }
"hour": { day: "numeric" }
"minute": { minute: "numeric" }
"second": { second: "numeric" }
Reference: https://tc39.es/ecma402/#sec-datetimeformat-abstracts

dynamicDataSource.description:
An object that allows you to create a dynamic layer with data
either from map service sublayers or data from a registered workspace.

{@link https://developers.arcgis.com/javascript/latest/api-reference/esri-layers-FeatureLayer.html#dynamicDataSource Read more...}

editFieldsInfo.description:
The editor tracking fields, which record who adds or edits the data through the feature service
and when edits are made.

{@link https://developers.arcgis.com/javascript/latest/api-reference/esri-layers-FeatureLayer.html#editFieldsInfo Read more...}

effectiveEditingEnabled.description:
Indicates whether the layer is editable taking in to consideration privileges of the
currently signed-in user.

{@link https://developers.arcgis.com/javascript/latest/api-reference/esri-layers-FeatureLayer.html#effectiveEditingEnabled Read more...}

objectIdField.description:
The name of an `oid` {@link https://developers.arcgis.com/javascript/latest/api-reference/esri-layers-FeatureLayer.html#fields field} containing
a unique value or identifier for each feature in the layer.

{@link https://developers.arcgis.com/javascript/latest/api-reference/esri-layers-FeatureLayer.html#objectIdField Read more...}

sourceJSON.description:
The [feature service's metadata JSON](https://developers.arcgis.com/rest/services-reference/layer-feature-service-.htm)
exposed by the ArcGIS REST API.

{@link https://developers.arcgis.com/javascript/latest/api-reference/esri-layers-FeatureLayer.html#sourceJSON Read more...}

title.description:
The title of the layer used to identify it in places such as the {@link https://developers.arcgis.com/javascript/latest/api-reference/esri-widgets-Legend.html Legend}
and {@link https://developers.arcgis.com/javascript/latest/api-reference/esri-widgets-LayerList.html LayerList} widgets.

{@link https://developers.arcgis.com/javascript/latest/api-reference/esri-layers-FeatureLayer.html#title Read more...}

labelingInfo.description:
The label definition for this layer, specified as an array of
{@link https://developers.arcgis.com/javascript/latest/api-reference/esri-layers-support-LabelClass.html LabelClass}.

{@link https://developers.arcgis.com/javascript/latest/api-reference/esri-layers-FeatureLayer.html#labelingInfo Read more...}

timeInfo.description:
TimeInfo provides information such as date fields that store
{@link https://developers.arcgis.com/javascript/latest/api-reference/esri-layers-support-TimeInfo.html#startField start}
and {@link https://developers.arcgis.com/javascript/latest/api-reference/esri-layers-support-TimeInfo.html#endField end} time
for each feature and the {@link https://developers.arcgis.com/javascript/latest/api-reference/esri-layers-support-TimeInfo.html#fullTimeExtent fullTimeExtent}
for the layer.

__esri.DynamicDataLayer.description:
A dynamic data layer is a layer created on-the-fly with data stored in a
[registered workspace](https://enterprise.arcgis.com/en/server/latest/manage-data/windows/overview-register-data-with-arcgis-server.htm).

{@link https://developers.arcgis.com/javascript/latest/api-reference/esri-layers-support-Sublayer.html#DynamicDataLayer Read more...}

__esri.DynamicMapLayer.description:
A dynamic map layer refers to a layer published in a map service that has
dynamic layers enabled.

{@link https://developers.arcgis.com/javascript/latest/api-reference/esri-layers-support-Sublayer.html#DynamicMapLayer Read more...}

isWebMercator.description:
Indicates if the {@link https://developers.arcgis.com/javascript/latest/api-reference/esri-geometry-SpatialReference.html#wkid wkid} of the spatial reference object is one of the following values:
`102113`, `102100`, `3857`.

{@link https://developers.arcgis.com/javascript/latest/api-reference/esri-geometry-SpatialReference.html#isWebMercator Read more...}

isWGS84.description:
Indicates if the {@link https://developers.arcgis.com/javascript/latest/api-reference/esri-geometry-SpatialReference.html#wkid wkid} of the spatial reference object is
`4326`.

{@link https://developers.arcgis.com/javascript/latest/api-reference/esri-geometry-SpatialReference.html#isWGS84 Read more...}

isWrappable.description:
Indicates if the spatial reference of the map supports wrapping around the International
Date Line.

{@link https://developers.arcgis.com/javascript/latest/api-reference/esri-geometry-SpatialReference.html#isWrappable Read more...}

elements.description:
An array of attribute table element
objects that represent an ordered list of table elements.

{@link https://developers.arcgis.com/javascript/latest/api-reference/esri-tables-AttributeTableTemplate.html#elements Read more...}

excludedEffect.description:
The {@link https://developers.arcgis.com/javascript/latest/api-reference/esri-layers-support-FeatureEffect.html#Effect effect} applied to features that do not meet
the {@link https://developers.arcgis.com/javascript/latest/api-reference/esri-layers-support-FeatureEffect.html#filter filter} requirements.

{@link https://developers.arcgis.com/javascript/latest/api-reference/esri-layers-support-FeatureEffect.html#excludedEffect Read more...}

isSelfIntersecting.description:
Checks to see if polygon rings cross each other and indicates if the polygon is
self-intersecting, which means the ring of the polygon crosses itself.

{@link https://developers.arcgis.com/javascript/latest/api-reference/esri-geometry-Polygon.html#isSelfIntersecting Read more...}

components.description:
An array of mesh components that can be used to apply materials
to different regions of the same mesh.

{@link https://developers.arcgis.com/javascript/latest/api-reference/esri-geometry-Mesh.html#components Read more...}

details.description:
The details object provides additional details specific to the error,
giving more information about why the error was raised.

{@link https://developers.arcgis.com/javascript/latest/api-reference/esri-core-Error.html#details Read more...}

fields.description:
An array of aggregate fields that summarize layer {@link https://developers.arcgis.com/javascript/latest/api-reference/esri-layers-FeatureLayer.html#fields fields}
from features contained within each bin.

{@link https://developers.arcgis.com/javascript/latest/api-reference/esri-layers-support-FeatureReductionBinning.html#fields Read more...}

labelingInfo.description:
Defines labels for bins as an array of
{@link https://developers.arcgis.com/javascript/latest/api-reference/esri-layers-support-LabelClass.html LabelClass}.

{@link https://developers.arcgis.com/javascript/latest/api-reference/esri-layers-support-FeatureReductionBinning.html#labelingInfo Read more...}

statisticType.description:
Defines the type of statistic used to aggregate data returned from {@link https://developers.arcgis.com/javascript/latest/api-reference/esri-layers-support-AggregateField.html#onStatisticField onStatisticField}
or {@link https://developers.arcgis.com/javascript/latest/api-reference/esri-layers-support-AggregateField.html#onStatisticExpression onStatisticExpression}.

{@link https://developers.arcgis.com/javascript/latest/api-reference/esri-layers-support-AggregateField.html#statisticType Read more...}

onStatisticExpression.description:
An object containing an {@link https://developers.arcgis.com/javascript/latest/arcade/ Arcade} expression, which evaluates for each child feature represented
by the aggregate graphic.

{@link https://developers.arcgis.com/javascript/latest/api-reference/esri-layers-support-AggregateField.html#onStatisticExpression Read more...}

expression.description:
An {@link https://developers.arcgis.com/javascript/latest/arcade/ Arcade} expression following
the specification defined by the {@link https://developers.arcgis.com/javascript/latest/arcade/#visualization Arcade Visualization Profile}.

{@link https://developers.arcgis.com/javascript/latest/api-reference/esri-layers-support-ExpressionInfo.html#expression Read more...}

useCodedValues.description:
Indicates whether to use domain names if the fields in the {@link https://developers.arcgis.com/javascript/latest/api-reference/esri-layers-support-LabelClass.html#labelExpression labelExpression}
or {@link https://developers.arcgis.com/javascript/latest/api-reference/esri-layers-support-LabelClass.html#labelExpressionInfo labelExpressionInfo} have domains.

{@link https://developers.arcgis.com/javascript/latest/api-reference/esri-layers-support-LabelClass.html#useCodedValues Read more...}

symbolLayers.description:
A Collection of {@link https://developers.arcgis.com/javascript/latest/api-reference/esri-symbols-Symbol3DLayer.html Symbol3DLayer} objects
used to visualize the graphic or feature.

{@link https://developers.arcgis.com/javascript/latest/api-reference/esri-symbols-LabelSymbol3D.html#symbolLayers Read more...}

authorizedCrossOriginDomains.description:
Array of trusted servers to send credentials to when making Cross-Origin Resource Sharing (CORS) requests to access services
secured with web-tier authentication.

{@link https://developers.arcgis.com/javascript/latest/api-reference/esri-portal-Portal.html#authorizedCrossOriginDomains Read more...}

basemapGalleryGroupQuery.description:
The query that defines the basemaps that should be displayed in the
{@link https://developers.arcgis.com/javascript/latest/api-reference/esri-widgets-BasemapGallery.html BasemapGallery} when {@link https://developers.arcgis.com/javascript/latest/api-reference/esri-portal-Portal.html#useVectorBasemaps useVectorBasemaps} is not true.

{@link https://developers.arcgis.com/javascript/latest/api-reference/esri-portal-Portal.html#basemapGalleryGroupQuery Read more...}

basemapGalleryGroupQuery3D.description:
The query that defines the 3D basemaps that should be displayed in the
{@link https://developers.arcgis.com/javascript/latest/api-reference/esri-widgets-BasemapGallery.html BasemapGallery}.

{@link https://developers.arcgis.com/javascript/latest/api-reference/esri-portal-Portal.html#basemapGalleryGroupQuery3D Read more...}

devBasemapGalleryGroupQuery.description:
The query that defines the basemaps that should be displayed in the
{@link https://developers.arcgis.com/javascript/latest/api-reference/esri-widgets-BasemapGallery.html BasemapGallery} when an {@link https://developers.arcgis.com/javascript/latest/api-reference/esri-config.html#apiKey apiKey} is defined.

{@link https://developers.arcgis.com/javascript/latest/api-reference/esri-portal-Portal.html#devBasemapGalleryGroupQuery Read more...}

restUrl.description:
The REST URL for the portal, for example "https://www.arcgis.com/sharing/rest" for ArcGIS Online
and "https://www.example.com/arcgis/sharing/rest" for your in-house portal.

{@link https://developers.arcgis.com/javascript/latest/api-reference/esri-portal-Portal.html#restUrl Read more...}

templatesGroupQuery.description:
The query that defines the collection of templates that will appear in the template
gallery.

{@link https://developers.arcgis.com/javascript/latest/api-reference/esri-portal-Portal.html#templatesGroupQuery Read more...}

use3dBasemaps.description:
When `false`, 3D basemaps are hidden from the {@link https://developers.arcgis.com/javascript/latest/api-reference/esri-widgets-BasemapGallery.html BasemapGallery}, regardless
of the type of the view.

{@link https://developers.arcgis.com/javascript/latest/api-reference/esri-portal-Portal.html#use3dBasemaps Read more...}

vectorBasemapGalleryGroupQuery.description:
The query that defines the vector tiles basemaps that should be displayed in the
{@link https://developers.arcgis.com/javascript/latest/api-reference/esri-widgets-BasemapGallery.html BasemapGallery} when {@link https://developers.arcgis.com/javascript/latest/api-reference/esri-portal-Portal.html#useVectorBasemaps useVectorBasemaps} is true.

{@link https://developers.arcgis.com/javascript/latest/api-reference/esri-portal-Portal.html#vectorBasemapGalleryGroupQuery Read more...}

isOrgItem.description:
Indicates whether this item and the user whose credential was used to fetch this item belong
to the same ArcGIS Enterprise Portal or ArcGIS Online Organization.

{@link https://developers.arcgis.com/javascript/latest/api-reference/esri-portal-PortalItem.html#isOrgItem Read more...}

region.description:
The user preferred region, used to set the featured maps on the home page,
content in the gallery, and the default extent of new maps in the Viewer.

{@link https://developers.arcgis.com/javascript/latest/api-reference/esri-portal-PortalUser.html#region Read more...}

expression.description:
An {@link https://developers.arcgis.com/javascript/latest/arcade/ Arcade} expression following
the specification defined by the {@link https://developers.arcgis.com/javascript/latest/arcade/#popup Arcade Popup Profile}.

{@link https://developers.arcgis.com/javascript/latest/api-reference/esri-popup-ExpressionInfo.html#expression Read more...}

title.description:
The title used to describe the value returned by the expression in the
popup.

{@link https://developers.arcgis.com/javascript/latest/api-reference/esri-popup-ExpressionInfo.html#title Read more...}

fieldName.description:
The field name as defined by the service or the name of
an {@link https://developers.arcgis.com/javascript/latest/arcade/ Arcade}
expression.

{@link https://developers.arcgis.com/javascript/latest/api-reference/esri-popup-FieldInfo.html#fieldName Read more...}

statisticType.description:
Used in a `one:many` or `many:many` relationship to compute the statistics
on the field to show in the popup.

{@link https://developers.arcgis.com/javascript/latest/api-reference/esri-popup-FieldInfo.html#statisticType Read more...}

format.description:
Class which provides formatting options for numerical or date fields and how they should display within
a popup.

{@link https://developers.arcgis.com/javascript/latest/api-reference/esri-popup-FieldInfo.html#format Read more...}

places.description:
Used only with `Number` fields to specify the number of supported decimal places
that should appear in popups.

{@link https://developers.arcgis.com/javascript/latest/api-reference/esri-popup-support-FieldInfoFormat.html#places Read more...}

defaultLabel.description:
Label used in the {@link https://developers.arcgis.com/javascript/latest/api-reference/esri-widgets-Legend.html Legend} to describe features assigned the
{@link https://developers.arcgis.com/javascript/latest/api-reference/esri-renderers-ClassBreaksRenderer.html#defaultSymbol default symbol}.

{@link https://developers.arcgis.com/javascript/latest/api-reference/esri-renderers-ClassBreaksRenderer.html#defaultLabel Read more...}

normalizationField.description:
When {@link https://developers.arcgis.com/javascript/latest/api-reference/esri-renderers-ClassBreaksRenderer.html#normalizationType normalizationType} is `field`, this property contains the
attribute field name used for normalization.

{@link https://developers.arcgis.com/javascript/latest/api-reference/esri-renderers-ClassBreaksRenderer.html#normalizationField Read more...}

normalizationTotal.description:
When {@link https://developers.arcgis.com/javascript/latest/api-reference/esri-renderers-ClassBreaksRenderer.html#normalizationType normalizationType} is `percent-of-total`, this property
contains the total of all data values.

{@link https://developers.arcgis.com/javascript/latest/api-reference/esri-renderers-ClassBreaksRenderer.html#normalizationTotal Read more...}

valueExpression.description:
An {@link https://developers.arcgis.com/javascript/latest/arcade/ Arcade} expression following the specification
defined by the {@link https://developers.arcgis.com/javascript/latest/arcade/#visualization Arcade Visualization Profile}.

{@link https://developers.arcgis.com/javascript/latest/api-reference/esri-renderers-ClassBreaksRenderer.html#valueExpression Read more...}

valueExpressionTitle.description:
The title identifying and describing the associated {@link https://developers.arcgis.com/javascript/latest/arcade/ Arcade}
expression as defined in the {@link https://developers.arcgis.com/javascript/latest/api-reference/esri-renderers-ClassBreaksRenderer.html#valueExpression valueExpression} property.

{@link https://developers.arcgis.com/javascript/latest/api-reference/esri-renderers-ClassBreaksRenderer.html#valueExpressionTitle Read more...}

backgroundFillSymbol.description:
When symbolizing polygon features with graduated symbols, set a {@link https://developers.arcgis.com/javascript/latest/api-reference/esri-symbols-FillSymbol.html FillSymbol}
on this property to visualize the boundaries of each feature.

{@link https://developers.arcgis.com/javascript/latest/api-reference/esri-renderers-ClassBreaksRenderer.html#backgroundFillSymbol Read more...}

classBreakInfos.description:
Each element in the array is an object that provides information about a class break
associated with the renderer.

{@link https://developers.arcgis.com/javascript/latest/api-reference/esri-renderers-ClassBreaksRenderer.html#classBreakInfos Read more...}

symbolLayers.description:
A Collection of {@link https://developers.arcgis.com/javascript/latest/api-reference/esri-symbols-Symbol3DLayer.html Symbol3DLayer} objects
used to visualize the graphic or feature.

{@link https://developers.arcgis.com/javascript/latest/api-reference/esri-symbols-PolygonSymbol3D.html#symbolLayers Read more...}

symbol.description:
Defines the symbol used to render features with data values that are within the bounds
defined for the class break.

{@link https://developers.arcgis.com/javascript/latest/api-reference/esri-renderers-support-ClassBreakInfo.html#symbol Read more...}

symbolLayers.description:
A Collection of {@link https://developers.arcgis.com/javascript/latest/api-reference/esri-symbols-Symbol3DLayer.html Symbol3DLayer} objects
used to visualize the graphic or feature.

{@link https://developers.arcgis.com/javascript/latest/api-reference/esri-symbols-LineSymbol3D.html#symbolLayers Read more...}

A Collection of {@link https://developers.arcgis.com/javascript/latest/api-reference/esri-symbols-Symbol3DLayer.html Symbol3DLayer} objects
used to visualize the graphic or feature.

{@link https://developers.arcgis.com/javascript/latest/api-reference/esri-symbols-MeshSymbol3D.html#symbolLayers Read more...}

A Collection of {@link https://developers.arcgis.com/javascript/latest/api-reference/esri-symbols-Symbol3DLayer.html Symbol3DLayer} objects
used to visualize the graphic or feature.

{@link https://developers.arcgis.com/javascript/latest/api-reference/esri-symbols-PointSymbol3D.html#symbolLayers Read more...}

field.description:
The name of the numeric attribute field that contains the data
