{@link https://developers.arcgis.com/javascript/latest/api-reference/esri-widgets-Legend.html Legend}.

{@link https://developers.arcgis.com/javascript/latest/api-reference/esri-renderers-support-UniqueValueClass.html#label Read more...}

value.description:
Defines a value (possibly in combination with {@link https://developers.arcgis.com/javascript/latest/api-reference/esri-renderers-support-UniqueValue.html#value2 value2} and {@link https://developers.arcgis.com/javascript/latest/api-reference/esri-renderers-support-UniqueValue.html#value3 value3}) returned from the field
