{@link https://developers.arcgis.com/javascript/latest/api-reference/esri-renderers-support-UniqueValue.html#value Read more...}

value2.description:
Defines a value returned from the field referenced in {@link https://developers.arcgis.com/javascript/latest/api-reference/esri-renderers-UniqueValueRenderer.html#field2 UniqueValueRenderer.field2}
to be categorized in combination with {@link https://developers.arcgis.com/javascript/latest/api-reference/esri-renderers-support-UniqueValue.html#value value} (and possibly {@link https://developers.arcgis.com/javascript/latest/api-reference/esri-renderers-support-UniqueValue.html#value3 value3}) in a {@link https://developers.arcgis.com/javascript/latest/api-reference/esri-renderers-support-UniqueValueClass.html UniqueValueClass}.

{@link https://developers.arcgis.com/javascript/latest/api-reference/esri-renderers-support-UniqueValue.html#value2 Read more...}

value3.description:
Defines a value returned from the field referenced in {@link https://developers.arcgis.com/javascript/latest/api-reference/esri-renderers-UniqueValueRenderer.html#field3 UniqueValueRenderer.field3}
to be categorized in combination with {@link https://developers.arcgis.com/javascript/latest/api-reference/esri-renderers-support-UniqueValue.html#value value} and {@link https://developers.arcgis.com/javascript/latest/api-reference/esri-renderers-support-UniqueValue.html#value2 value2} in a {@link https://developers.arcgis.com/javascript/latest/api-reference/esri-renderers-support-UniqueValueClass.html UniqueValueClass}.

